This book is by Shane Peacock

Please be aware that this is an advanced reading copy of the book, the story is still all there and is the final version just some of the graphics are missing on some of the very first pages and there is a large watermark on the side of the page that says &quot;advanced reading copy&quot; this hover doesn't go over the words so it is still readable if only a tad annoying.

